import React from 'react';
import './Cards.css';

import Card from './Card.jsx';

export default function Cards({cities, onClose}) {
  if(cities){
    return (
    <div className='background'>
      <div className='cards'>
        {cities.map(c => <Card
            max={c.max}
            min={c.min}
            name={c.name}
            img={c.img}

            onClose={() => onClose(c.id)}

            id={c.id}
          /> )}
      </div>
    </div> );
  } else {
    return(
      <div>Sin ciudades</div>
   )
  }
}
